syntax = "proto3";
option java_package="com.newbit.common.proto.push";
option java_outer_classname = "MarketProto";

message Market{

   Body market = 1;

  message Body{
    string high = 1;
    string low = 2;
    string volume = 3;
    string last = 4;
    string open = 5;
    string chg = 6;
    int64 time = 7;
    string quoteVolume = 8;
    string symbolWassName = 9;
  }

}
